import { Fragment, useState } from "react";
import {
  FormControl,
  InputLabel,
  MenuItem,
  Select,
  FormControlLabel,
  Radio,
  RadioGroup,
  TableContainer,
  TableCell,
  TableBody,
  TableHead,
  Table,
  TableRow,
  Paper,
} from "@mui/material";
import "./ExchangeHistory.css";
import Charts from "../../UI/Chart";

import ExchangeHistoryForm from "./ExchangeHistoryForm";

const ExchangeHistroy = (props) => {
  const currency = props.currencyTo;
  const exchangeHistory = props.exchangeRateHistory;
  const minCurrencyValue = props.min;
  const maxCurrencyValue = props.max;
  const averageCurrencyValue = props.average;
  const [showReport, setShowReport] = useState("table");

  const getExchangeHistory = (event) => {
    props.exchangeHistoryHandler(event.target.value);
  };

  const switchReportHandler = (event) => {
    setShowReport(event.target.value);
  };

  return (
    <Fragment>
      <ExchangeHistoryForm duration={props.duration} getExchangeHistory={getExchangeHistory} switchReportHandler={switchReportHandler} />

      {showReport === "table" ? (
        <div className="view-conversion">
          <div className="exchange-rate-datewise">
            <TableContainer component={Paper}>
              <Table sx={{ maxWidth: "100%" }} aria-label="simple table">
                <TableHead>
                  <TableRow>
                    <TableCell>Date</TableCell>
                    <TableCell align="left">Exchange rate</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {Object.entries(exchangeHistory).map((currentValue) => {
                    return (
                      <TableRow
                        key={currentValue[0]}
                        sx={{
                          "&:last-child td, &:last-child th": { border: 0 },
                        }}
                      >
                        <TableCell component="th" scope="row">
                          {currentValue[0]}
                        </TableCell>
                        <TableCell align="left">
                          {currentValue[1][currency]}
                        </TableCell>
                      </TableRow>
                    );
                  })}
                </TableBody>
              </Table>
            </TableContainer>
          </div>
          <div className="statistics">
            <TableContainer component={Paper}>
              <Table sx={{ maxWidth: "100%" }} aria-label="simple table">
                <TableHead>
                  <TableRow>
                    <TableCell>Statistics</TableCell>
                    <TableCell align="left"></TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  <TableRow
                    sx={{
                      "&:last-child td, &:last-child th": { border: 0 },
                    }}
                  >
                    <TableCell component="th" scope="row">
                      Lowest
                    </TableCell>
                    <TableCell component="th" scope="row">
                      {minCurrencyValue}
                    </TableCell>
                  </TableRow>
                  <TableRow>
                    <TableCell component="th" scope="row">
                      Highest
                    </TableCell>
                    <TableCell align="left">{maxCurrencyValue}</TableCell>
                  </TableRow>
                  <TableRow>
                    <TableCell component="th" scope="row">
                      Average
                    </TableCell>
                    <TableCell align="left">{averageCurrencyValue}</TableCell>
                  </TableRow>
                </TableBody>
              </Table>
            </TableContainer>
          </div>
        </div>
      ) : (
        <div className="view-conversion">
          <div className="exchange-rate-datewise">

            <Charts data={props?.chartData} label={props?.chartLabel} />

          </div>
          {
            minCurrencyValue && maxCurrencyValue && averageCurrencyValue && (

              <div className="statistics">

                <Charts
                  data={["Lowest", "Highest", "Average"]}
                  label={[
                    minCurrencyValue,
                    maxCurrencyValue,
                    averageCurrencyValue,
                  ]}
                />
              </div>
            )
          }
        </div>
      )}
    </Fragment>
  );
};

export default ExchangeHistroy;
